import Vue from 'vue';
import { createRouter, createWebHistory } from 'vue-router';
import Home from '../components/AppHome.vue';
import Login from '../components/UserLogin.vue';

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/login',
      name: 'login',
      component: Login
    }
  ]
});
